			<button onClick={ funcEnableFilters }>Set Enable</button>
			<p> Default(URL) Store: {defaultStore}</p>
			<p> Selected Store: {newSelectedStore}</p>
			<p>{ newData }</p>
		</div>
	  );
}

export default App;
